import React from "react";
import {makeStyles} from "@material-ui/core";

const useStyles = makeStyles((theme)=>({
    root: {
        flexGrow: 1,
    },

    menuButton: {
        marginRight: theme.spacing(2),
    },

    title: {
        flexGrow: 1,
    },

}));

const AdminPage =()=> {

    const classes = useStyles();
    return(
        <>

            <Box sx={{ flexGrow: 0 }}>
                <AppBar position="static">
                    <Toolbar>
                        <IconButton
                            className={classes.menuButton}
